    /**
     * Delegates to {@link #getSeededTriOmniTiling(int, int, int)}; this is an alias for compatibility.
     * @param x         x position, can be any int; results will not repeat for a very long time
     * @param y         y position, can be any int; results will not repeat for a very long time
     * @param seed      seed value, can be any int; should be the same for all calls that should be from the same 2D plane
     * @return a byte that obeys a triangular-blue-noise distribution, so a value is only next to a similar value rarely
     */
    public static byte getSeededTriangular(final int x, final int y, int seed) {
        return getSeededTriOmniTiling(x, y, seed);
    }

    /**
     * Gets a point in a potentially-infinite aperiodically-tiling plane of blue noise, where each 64x64 square of blue
     * noise is drawn from {@link #TILE_NOISE}. Because each square of TILE_NOISE can tile with any other from that
     * group, this can choose those squares randomly, and it does so using a simplistic (and fast) hash based on
     * Cantor's pairing function. Unlike earlier attempts here to make aperiodic tilings of blue noise, this makes
     * high-quality blue noise that satisfies the progressive quality. Big thanks to Bart Wronski for making Ulichney's
     * Void and Cluster algorithm accessible to me, and Alan Wolfe for helping me understand how useful blue noise is in
     * the first place!
     * <br>
     * <a href="https://i.imgur.com/aIRKSaO.png">Blue noise at left, magnitude histogram at right.</a>
     * @param x x coordinate, in grid cells, pixels, or some other fine-grained measurement
     * @param y y coordinate, in grid cells, pixels, or some other fine-grained measurement
     * @param seed only the low 18 bits will be used, so this should probably be between 0 and 250000, roughly
     * @return a byte obeying a blue noise distribution
     */
    public static byte getSeededOmniTiling(final int x, final int y, final int seed) {
        final int a = x >>> 6 ^ seed >>> 6;
        final int b = y >>> 6 ^ seed >>> 12;
        return TILE_NOISE[seed + b + ((a + b) * (a + b + 1) >> 1) & 63][(y << 6 & 0xFC0) | (x & 0x3F)];
    }

    /**
     * Gets a point in a potentially-infinite aperiodically-tiling plane of blue noise, where each 64x64 square of blue
     * noise is drawn from {@link #TILE_TRI_NOISE} (which is blue noise with a triangular mapping). The triangular
     * mapping may improve the appearance of the blue noise when used for dithering or other smoothly-fading gradients.
     * Because each square of TILE_TRI_NOISE can tile with any other from that group, this can choose those squares
     * randomly, and it does so using a simplistic (and fast) hash based on Cantor's pairing function. Unlike earlier
     * attempts here to make aperiodic tilings of blue noise, this makes high-quality blue noise that satisfies the
     * progressive quality. Big thanks to Bart Wronski for making Ulichney's Void and Cluster algorithm accessible to
     * me, and Alan Wolfe for helping me understand how useful blue noise is in the first place!
     * <br>
     * <a href="https://i.imgur.com/4bE8iKt.png">Blue noise at left, magnitude histogram at right.</a>
     * @param x x coordinate, in grid cells, pixels, or some other fine-grained measurement
     * @param y y coordinate, in grid cells, pixels, or some other fine-grained measurement
     * @param seed only the low 18 bits will be used
     * @return a byte obeying a triangular-mapped blue noise distribution
     */
    public static byte getSeededTriOmniTiling(final int x, final int y, final int seed) {
        final int a = x >>> 6 ^ seed >>> 6;
        final int b = y >>> 6 ^ seed >>> 12;
        return TILE_TRI_NOISE[seed + b + ((a + b) * (a + b + 1) >> 1) & 63][(y << 6 & 0xFC0) | (x & 0x3F)];
    }
